import React from 'react';

function PersonTable({ people }) {
    return (
        <table border="1" style={{ marginTop: '20px', width: '100%' }}>
            <thead>
                <tr>
                    <th>Name</th>
                    <th>Email</th>
                    <th>Phone</th>
                </tr>
            </thead>
            <tbody>
                {people.map((person, index) => (
                    <tr key={index}>
                        <td>{person.name}</td>
                        <td>{person.email}</td>
                        <td>{person.phone}</td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
}
export default PersonTable;
